import React from 'react';
import '../Styles/paginationcard.css';

const PaginatorCard = (props) => {
    return (
        <div className="paginationCardComponent">
                        <div>{props.name}</div>
                        <img className="paginationImage" src={props.image} />
                        <div>{props.ty}</div>

        </div>
    );
}

export default PaginatorCard;
